import React from 'react';
import '../styles/Dashboard.css';

function Dashboard() {
  return (
    <div className="dashboard">
      <h2>Your Dashboard</h2>
      <p>View and manage your shared skills here.</p>
    </div>
  );
}

export default Dashboard;
